import React, { Component } from 'react';
import './App.css';

class App extends Component {

  state = {
    data: [],
    cal: [],
    vitE: []
  }

  componentDidMount(){
    fetch('https://api.nal.usda.gov/ndb/reports/?ndbno=01009&type=f&format=json&api_key=deSFRe23fryJ5XJpEjRJwqWhVGkfFWzXWvpymagG')
    .then(resp=>resp.json())
    .then(resp=>{
      // console.log(resp);
      this.setState({
        data: resp.report.food
      })      
    })

    fetch('https://api.nal.usda.gov/ndb/nutrients/?format=json&api_key=deSFRe23fryJ5XJpEjRJwqWhVGkfFWzXWvpymagG&nutrients=205&nutrients=204&nutrients=208&nutrients=269&nutrients=401&nutrients=323&nutrients=328&ndbno=01009')
    .then(resp=>resp.json())
    .then(resp=>{
      console.log(resp);
      this.setState({
        cal: Math.round(resp.report.foods[0].nutrients[4].gm * 4),
        vitE: resp.report.foods[0].nutrients[0].gm,
      })      
    })
  }

  render() {
    console.log(`state:`, this.state.data);
    // console.log(this.state.nutrientdata.sr)
    const { data, cal, vitE } = this.state;
    return (
      <div className="App">
        <header className="App-header">
          <h1>USDA</h1>
        </header>
        <main>
          <div className="display" style={{ width: '500px', height: '300px'}}>
            <h2>{data.name}</h2>
            <p>{data.fg}</p>
            <p>calories: {cal}</p>
            <p>vitamin E: {vitE}</p>
          </div>
        </main>
      </div>
    );
  }
}

export default App;

